function waitForElementToDisplay(selector, time) {
    var itemsToShow = 6;
    var itemsToRemove = $('.flex-control-nav li').length - itemsToShow;
    if(document.querySelector(selector)!=null) {       
        let slider = $('.flexslider');
        for(let i =0; i < itemsToRemove; i++){
            $('.slides li:nth-last-child(2)').remove();
            let lastIndex = slider.data('flexslider').count;
            slider.data('flexslider').removeSlide(lastIndex);
            slider.flexslider(0);
        }
        $('.flex-control-nav.flex-control-paging li:last-child a').html(slider.data('flexslider').count);
        return;
    }
    else {
        setTimeout(function() {
            waitForElementToDisplay(selector, time);
        }, time);
    }    
}

